export function updateSubjectWin(subjectScore: PersonScore, otherScore: PersonScore) {
  if (isSubjectSetPoint(subjectScore, otherScore)) {
    subjectScore.gamesByCompletedSet.push(subjectScore.games + 1);
    subjectScore.games = 0;
    subjectScore.points = 0;
    subjectScore.serve = 0;
    otherScore.gamesByCompletedSet.push(otherScore.games);
    otherScore.games = 0;
    otherScore.points = 0;
    otherScore.serve = 0;
    return;
  }
  if (isSubjectGamePoint(subjectScore, otherScore)) {
    subjectScore.games += 1;
    subjectScore.points = 0;
    subjectScore.serve = 0;
    otherScore.points = 0;
    otherScore.serve = 0;
    return;
  }
  subjectScore.points += 1;
  subjectScore.serve = 0;
  otherScore.serve = 0;
}

function isSubjectGamePoint(subjectScore: PersonScore, otherScore: PersonScore) {
  let deuceScore = isTieBreakTime(subjectScore, otherScore) ? 6 : 3;
  return subjectScore.points >= deuceScore && subjectScore.points - otherScore.points >= 1;
}

function isSubjectSetPoint(subjectScore: PersonScore, otherScore: PersonScore) {
  if (!isSubjectGamePoint(subjectScore, otherScore)) {
    return false;
  }
  if (isTieBreakTime(subjectScore, otherScore)) {
    return true;
  }
  return subjectScore.games >= 5 && subjectScore.games - otherScore.games >= 1;
}


export function annotateMatchStat(rallyContexts: RallyContext[]) {
  const stat = new MatchStat();
  rallyContexts.forEach((rallyContext) => {
    rallyContext.matchStatBeforeRally = stat.clone();

    // Check game points and set points using direct score comparison
    if (isSubjectGamePoint(rallyContext.scoreBeforeRally.p1, rallyContext.scoreBeforeRally.p2)) {
      stat.p1Stats.numGamePts++;
      if (isSubjectSetPoint(rallyContext.scoreBeforeRally.p1, rallyContext.scoreBeforeRally.p2)) {
        stat.p1Stats.numSetPts++;
      }
    }
    if (isSubjectGamePoint(rallyContext.scoreBeforeRally.p2, rallyContext.scoreBeforeRally.p1)) {
      stat.p2Stats.numGamePts++;
      if (isSubjectSetPoint(rallyContext.scoreBeforeRally.p2, rallyContext.scoreBeforeRally.p1)) {
        stat.p2Stats.numSetPts++;
      }
    }

    function isReturnerPtForSecondServe(rallyContext: RallyContext) {
      if (!rallyContext.isSecondServe()) {
        return false;
      }
      return rallyContext.rally.result === RallyResult.PtReturner || rallyContext.rally.result === RallyResult.Fault;
    }
    if (rallyContext.rally.isMyServe) {
      const serverStats = stat.p1Stats;
      const returnerStats = stat.p2Stats;
      const isSecondServe = rallyContext.isSecondServe();

      if (isSecondServe) {
        if (rallyContext.rally.result !== RallyResult.Let) {
          serverStats.numSecondServes++;
        }
        if (rallyContext.rally.result !== RallyResult.Fault) {
          serverStats.numSecondServesMade++;
          if (rallyContext.rally.result === RallyResult.PtServer) {
            serverStats.numSecondServesWon++;
            if (isForcingWin(rallyContext)) {
              serverStats.numSecondServeForcingWins++;
            }
          } else if (isReturnerPtForSecondServe(rallyContext) && isForcingWin(rallyContext)) {
            returnerStats.numSecondServeForcingWinsByReturner++;
          }
        }
        if (isReturnerPtForSecondServe(rallyContext) && isUnforcedError(rallyContext)) {
          serverStats.numSecondServeUnforcedErrors++;
        }
        if (rallyContext.rally.result === RallyResult.PtServer && isUnforcedError(rallyContext)) {
          returnerStats.numSecondServeUnforcedErrorsByReturner++;
        }
      } else {
        if (rallyContext.rally.result !== RallyResult.Let) {
          serverStats.numFirstServes++;
        }
        if (rallyContext.rally.result !== RallyResult.Fault) {
          serverStats.numFirstServesMade++;
          if (rallyContext.rally.result === RallyResult.PtServer) {
            serverStats.numFirstServesWon++;
            if (isForcingWin(rallyContext)) {
              serverStats.numFirstServeForcingWins++;
            }
          } else if (rallyContext.rally.result === RallyResult.PtReturner && isForcingWin(rallyContext)) {
            returnerStats.numFirstServeForcingWinsByReturner++;
          }
        }
        if (rallyContext.rally.result === RallyResult.PtReturner && isUnforcedError(rallyContext)) {
          serverStats.numFirstServeUnforcedErrors++;
        }
        if (rallyContext.rally.result === RallyResult.PtServer && isUnforcedError(rallyContext)) {
          returnerStats.numFirstServeUnforcedErrorsByReturner++;
        }
      }
    } else {
      const serverStats = stat.p2Stats;
      const returnerStats = stat.p1Stats;
      const isSecondServe = rallyContext.isSecondServe();

      if (!isSecondServe) {
        serverStats.numFirstServes++;
        if (rallyContext.rally.result !== RallyResult.Fault) {
          serverStats.numFirstServesMade++;
          if (rallyContext.rally.result === RallyResult.PtServer) {
            serverStats.numFirstServesWon++;
            if (isForcingWin(rallyContext)) {
              serverStats.numFirstServeForcingWins++;
            }
          } else if (rallyContext.rally.result === RallyResult.PtReturner && isForcingWin(rallyContext)) {
            returnerStats.numFirstServeForcingWinsByReturner++;
          }
        }
        if (rallyContext.rally.result === RallyResult.PtReturner && isUnforcedError(rallyContext)) {
          serverStats.numFirstServeUnforcedErrors++;
        }
        if (rallyContext.rally.result === RallyResult.PtServer && isUnforcedError(rallyContext)) {
          returnerStats.numFirstServeUnforcedErrorsByReturner++;
        }
      } else {
        serverStats.numSecondServes++;
        if (rallyContext.rally.result !== RallyResult.Fault) {
          serverStats.numSecondServesMade++;
          if (rallyContext.rally.result === RallyResult.PtServer) {
            serverStats.numSecondServesWon++;
            if (isForcingWin(rallyContext)) {
              serverStats.numSecondServeForcingWins++;
            }
          } else if (isReturnerPtForSecondServe(rallyContext) && isForcingWin(rallyContext)) {
            returnerStats.numSecondServeForcingWinsByReturner++;
          }
        }
        if (isReturnerPtForSecondServe(rallyContext) && isUnforcedError(rallyContext)) {
          serverStats.numSecondServeUnforcedErrors++;
        }
        if (rallyContext.rally.result === RallyResult.PtServer && isUnforcedError(rallyContext)) {
          returnerStats.numSecondServeUnforcedErrorsByReturner++;
        }
      }
    }
  });
}

export class MatchStat {
  constructor(
    public p1Stats = new PlayerStat(),
    public p2Stats = new PlayerStat(),
  ) {}

  static deserialize(json: any) {
    return new MatchStat(
      PlayerStat.deserialize(json.p1Stats),
      PlayerStat.deserialize(json.p2Stats)
    );
  }

  clone() {
    return MatchStat.deserialize(JSON.parse(JSON.stringify(this)));
  }

  toString() {
    return JSON.stringify(this, null, 2);
  }

  getTotalNumPoints() {
    // For each player, count first serve points made + second serve attempts (including double faults)
    const p1Points = this.p1Stats.numFirstServesMade + this.p1Stats.numSecondServes;
    const p2Points = this.p2Stats.numFirstServesMade + this.p2Stats.numSecondServes;
    return p1Points + p2Points;
  }

  getP1PointsWon() {
    // Points won on serve (first + second serves)
    const servePointsWon = this.p1Stats.numFirstServesWon + this.p1Stats.numSecondServesWon;
    // Points won on return (when opponent served and lost)
    const returnPointsWon = (this.p2Stats.numFirstServesMade - this.p2Stats.numFirstServesWon) + 
                           (this.p2Stats.numSecondServesMade - this.p2Stats.numSecondServesWon) +
                           (this.p2Stats.numSecondServes - this.p2Stats.numSecondServesMade); // double faults
    return servePointsWon + returnPointsWon;
  }

  getP2PointsWon() {
    // Points won on serve (first + second serves)
    const servePointsWon = this.p2Stats.numFirstServesWon + this.p2Stats.numSecondServesWon;
    // Points won on return (when opponent served and lost)
    const returnPointsWon = (this.p1Stats.numFirstServesMade - this.p1Stats.numFirstServesWon) +
                           (this.p1Stats.numSecondServesMade - this.p1Stats.numSecondServesWon) +
                           (this.p1Stats.numSecondServes - this.p1Stats.numSecondServesMade); // double faults
    return servePointsWon + returnPointsWon;
  }

  getP1WinningPct() {
    const totalPoints = this.getTotalNumPoints();
    if (totalPoints === 0) {
      return '';
    }
    const p1Points = this.getP1PointsWon();
    return `${Math.floor((p1Points / totalPoints) * 100)}%`;
  }

  getP2WinningPct() {
    const totalPoints = this.getTotalNumPoints();
    if (totalPoints === 0) {
      return '';
    }
    const p2Points = this.getP2PointsWon();
    return `${Math.floor((p2Points / totalPoints) * 100)}%`;
  }

  getP1ForcingWinPct() {
    const totalPoints = this.getTotalNumPoints();
    if (totalPoints === 0) {
      return '';
    }
    const serverForcingWins = this.p1Stats.numFirstServeForcingWins + this.p1Stats.numSecondServeForcingWins;
    const returnerForcingWins = this.p2Stats.numFirstServeForcingWinsByReturner + this.p2Stats.numSecondServeForcingWinsByReturner;
    return `${Math.floor(((serverForcingWins + returnerForcingWins) / totalPoints) * 100)}%`;
  }

  getP2ForcingWinPct() {
    const totalPoints = this.getTotalNumPoints();
    if (totalPoints === 0) {
      return '';
    }
    const serverForcingWins = this.p2Stats.numFirstServeForcingWins + this.p2Stats.numSecondServeForcingWins;
    const returnerForcingWins = this.p1Stats.numFirstServeForcingWinsByReturner + this.p1Stats.numSecondServeForcingWinsByReturner;
    return `${Math.floor(((serverForcingWins + returnerForcingWins) / totalPoints) * 100)}%`;
  }

  getP1ForcingWinPctOnServe() {
    const totalServePoints = this.p1Stats.numFirstServesMade + this.p1Stats.numSecondServes;
    if (totalServePoints === 0) {
      return '';
    }
    const forcingWins = this.p1Stats.numFirstServeForcingWins + this.p1Stats.numSecondServeForcingWins;
    return `${Math.floor((forcingWins / totalServePoints) * 100)}%`;
  }

  getP2ForcingWinPctOnServe() {
    const totalServePoints = this.p2Stats.numFirstServesMade + this.p2Stats.numSecondServes;
    if (totalServePoints === 0) {
      return '';
    }
    const forcingWins = this.p2Stats.numFirstServeForcingWins + this.p2Stats.numSecondServeForcingWins;
    return `${Math.floor((forcingWins / totalServePoints) * 100)}%`;
  }

  getP1ForcingWinPctOnFirstServe() {
    if (this.p1Stats.numFirstServesMade === 0) {
      return '';
    }
    return `${Math.floor((this.p1Stats.numFirstServeForcingWins / this.p1Stats.numFirstServesMade) * 100)}%`;
  }

  getP2ForcingWinPctOnFirstServe() {
    if (this.p2Stats.numFirstServesMade === 0) {
      return '';
    }
    return `${Math.floor((this.p2Stats.numFirstServeForcingWins / this.p2Stats.numFirstServesMade) * 100)}%`;
  }

  getP1ForcingWinPctOnSecondServe() {
    if (this.p1Stats.numSecondServes === 0) {
